import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './common/Header.js'; // Corrige los nombres de los archivos correctamente
import Footer from './common/Footer.js';
import UserForm from './components/users/userform.js';
import Jardines from './components/jardines/jardines.js'; // Importa como Jardines
import BlogPage from './components/blog/BlogPage'; // Asegúrate de que estas rutas sean correctas
import ContactPage from './components/contact/ContactPage';
import LoginPage from './components/login/LoginPage';
import LocationPage from './components/location/LocationPage';

function App() {
  return (
    <Router>
      <Header />
      <main>
        <Routes>
          <Route path="/" element={<UserForm />} />
          <Route path="/jardines" element={<Jardines />} />
          <Route path="/blog" element={<BlogPage />} />
          <Route path="/contacto" element={<ContactPage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/location" element={<LocationPage />} />
        </Routes>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
